from RecoJets.Configuration.RecoPFJets_cff import ak8PFJetsCHS, ak8PFJetsCHSSoftDrop
from RecoJets.JetProducers.ak8PFJetsCHS_groomingValueMaps_cfi import ak8PFJetsCHSSoftDropLinks
process.chs = cms.EDFilter("CandPtrSelector",
  src = cms.InputTag('packedPFCandidates'),
  cut = cms.string('fromPV')
)
process.ak8PFJetsCHSSoftDrop=ak8PFJetsCHSSoftDrop.clone( src = cms.InputTag('chs'), jetPtMin = 100.0 ) 
process.ak8PFJetsCHSSoftDrop.useExplicitGhosts=True
